mapper.select:
select
  ${fieldName}
from tb_metrics_disk_io
where
  hostName = #{hostName,jdbcType=VARCHAR}
  and
  heartbeatTime > #{startTime} and heartbeatTime <= #{endTime}
order by heartbeatTime desc
  limit 1

select * from (
  select
  ${function}(${fieldName}) as 'aggVal',
  systemDiskDevice as 'device'
  from tb_metrics_disk_io
  where
  hostName = #{hostName,jdbcType=VARCHAR}
  and
  heartbeatTimeMinute = #{sortTime,jdbcType=BIGINT}
  group by systemDiskDevice
) as agg_table
order by agg_table.aggVal ${sortType}

  limit #{topN}
